import { memo } from 'react'

function BookingDetail({ languageList }) {
    return (
        <div>
            <div className='d-flex'>
                <div className='section-tour-detail w-75 mr-10'>
                    <label className="d-block title-create-tour">{languageList.txtContact}</label>
                </div>
                <div className='section-tour-detail w-25 ml-10'></div>
            </div>
        </div>
    )
}

export default memo(BookingDetail)
